import React from "react";
import Card from "../Components/Card"

function Home() {


    return <div className="home-form">
        <div className="card card-body center">
            <h1>Welcome to Poolit</h1>
        </div>
        <div className="coach-card">
            <Card />
        </div>
    </div>
}


export default Home;
